Vòng đời sâu cuốn lá nhỏ từ 28 - 36 ngày. 
- Thời gian đẻ trứng:  6 - 7 ngày;
- Sâu non: 14 - 16 ngày;
- Nhộng: 6 - 7 ngày;
- Trưởng thành sống: 2 - 6 ngày. Ngài trưởng thành hoạt động đẻ trứng về đêm, ban ngày ẩn nấp, có xu tính mạnh với ánh sáng, con cái mạnh hơn con đực. Ngài thường tìm những ruộng xanh tốt để đẻ trứng, mỗi con cái có thể đẻ trên 100 quả trứng, rải rác trên lá lúa. Sâu non có 5 tuổi: Tuổi 1 rất linh hoạt có thể bò khắp trên lá, chui vào lá nõn, mặt trong bẹ lá hoặc bao lá cũ; tuổi 2, 3 trở đi nhả tơ để khâu 2 mép lá cuốn thành tổ nằm trong đó gây hại. Sâu có khả năng di chuyển ra khỏi bao cũ để phá hại lá mới, mỗi con sâu non có thể phá hại từ 5 -9 lá, thời gian di chuyển thường vào buổi chiều (từ 6 giờ - 9 giờ tối), ngày trời mưa hoặc râm mát thì có thể di chuyển bất cứ lúc nào trong ngày. Sâu non đẫy sức chuyển màu vàng hồng chui ra khỏi bao bò xuống gốc lúa, bẹ lá dệt kén mỏng hoá nhộng hoặc hoá nhộng ngay trong bao cũ.
